    false,nt"url": null,nt"notes": "NPScape conservation status metrics are
    calculated using data from the USGS Gap Analysis Program (PAD-US), World Protected
    Areas Database (WDPA), and National Marine Protected Areas Center (MPA). Metric
    GIS datasets are produced seamlessly for the United States (Lower 48, Alaska, Hawaiian
    Islands, Guam/American Samoa, Puerto Rico/US Virgin Islands), Canada, and Mexico,
    although both geographic coverage and resolution vary by source dataset. The methods
    underlying these calculations are available for download through the NPScape website:
